import React from 'react';
import './Category.css';

const Category=(props)=>{
    let DataProductList=props.DataProductList;
    let groups=[... new Set(DataProductList.map(x=>x.categoryGroup))];
    return(
        <div className="Category">
            <div className="category-header">Category</div>
            {groups.map(x=>(<div className="category-item">{x}<span className="downside">{">"}</span> </div>))}            
            <div className="category-item">Category <span className="downside">{">"}</span> </div>
            <div className="category-item">Category <span className="downside">{">"}</span> </div>
            <div className="category-item selected">Category <span className="downside">{">"}</span> </div>
        </div>
    );
}

export default Category;
